import { NavLink, Link } from 'react-router-dom';

function Header() {

    const clickStyle = {color: "red"};
    return(
        <header>
            <meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=0" />
            <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0-beta3/css/all.min.css" />
            <div className='inner'>
                <h1 className="logo"><NavLink exact to="/react_portfolio">Branden Min</NavLink></h1>
                <ul className="gnb">
                    <li><Link to="/react_portfolio">About</Link></li>
                    <li><Link to="/react_portfolio#projects">PROJECTS</Link></li>
                    <li><Link to="/react_portfolio#experiences">EXPERIENCES</Link></li>
                    <li><Link to="/react_portfolio#skills">SKILLS</Link></li>
                    <li>
  <a
    href="/react_portfolio/BrandenMin.pdf"
    target="_blank"
    rel="noopener noreferrer"
    onClick={(e) => {
      e.preventDefault();
      window.open('/react_portfolio/BrandenMin.pdf', '_blank');
    }}
  >
    CV
  </a>
</li>
                </ul>
                <div className="snsContact">
                        <a href="https://www.linkedin.com/in/brandenmin/" target='_blank'><i class="fa-brands fa-linkedin"></i></a>
                        <a href="https://github.com/Gemnnn" target='_blank'><i class="fa-brands fa-github"></i></a>
                        <a href="#"><i class="fa-brands fa-facebook"></i></a>
                </div>
            </div>
        </header>
    )
}

export default Header;
